import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import StartPage from './startPage';
import {BrowserRouter, Switch, Route} from 'react-router-dom';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Switch>
        <Route exact strict path="/(.*.{1,})">
          <StartPage/> 
        </Route>
        <Route>
          <StartPage/>
        </Route>
      </Switch>
    </BrowserRouter>
    <StartPage />
  </React.StrictMode>,
  document.getElementById('root')
);
